    number: '6'
    value: 'For the 2008 reporting period, the Missouri Republican State Committee
      followed and continues to follow a best  efforts policy to obtain identification
      for contributors: 1. All original solicitations include a clear and  conspicuous
      request for the contributor information and inform contributors that federal
      law requires committees  to use their best efforts to obtain such information.
      2. If information is not provided, a written request  is sent, within 30 days
      of the contribution receipt, clearly asking for the missing information without
      soliciting  a contribution, informing the contributor of the requirements of
      federal law for the reporting of such  information, and including a pre-addressed
      post card or return envelope. 3. Upon receipt of the requested contributor  information,
      an amended original report or an amended memo Schedule A listing all the contributions  for
      which additional information was received is filed with the next regularly scheduled
      report. Schedule A  supporting line 12 discloses transfers in from Republican
      National Committee. In accordance with 11CFR, transfered  funds were not used
      to pay for EXEMPT ACTIVITY on schedule B supporting line 30 (b). After correction  of
      the aggregate totals for Rufus Lumry, we noted his contributions aggregated
      over the allowed limit. A correction is noted on the 2008 Year-End amended report.'
