    Schedule A listing all the contributions  for which additional information was
    received is filed with the next regularly scheduled report. Schedule A  supporting
    line 12 discloses transfers in from Republican National Committee. In accordance
    with 11CFR, transfered  funds were not used to pay for EXEMPT ACTIVITY on schedule
